    def xacnhanthemdiem(self):
        cursor = db.cursor()

        for row in range(self.tableWidget_6.rowCount()):
            data = []
            for column in range(self.tableWidget_6.columnCount()):
                item = self.tableWidget_6.item(row, column)
                if item is not None:
                    data.append(item.text())
                else:
                    data.append('')

            # Kiểm tra xem dữ liệu đã tồn tại trong database chưa
            if self.check_data_exist(data[1],data[0],data[2]):
                # Nếu dữ liệu đã tồn tại, thực hiện update
                cursor.execute("UPDATE diem SET DIEM ={} WHERE IDMAMONHOC={} AND IDSINHVIEN={} AND HOCKI={}".format(data[3],data[1],data[0],data[2]))
            else:
                # Nếu dữ liệu chưa tồn tại, thực hiện insert mới
                cursor.execute("INSERT INTO diem (IDMAMONHOC, IDSINHVIEN, HOCKI,DIEM) VALUES ({},{},{},{})".format(data[1],data[0],data[2],data[3]))
                db.commit()
        self.tabWidget.setCurrentWidget(self.diemsv)
        self.loaddatatable4()

    def check_data_exist(self, idmamonhoc, idsinhvien, hocki):
        # Tạo câu lệnh SQL
        sql = "SELECT * FROM diem WHERE IDMAMONHOC = {} and IDSINHVIEN = {} AND HOCKI ={}".format(idmamonhoc,idsinhvien,hocki)
        query = "SELECT MAKHOA FROM KHOA WHERE TENKHOA LIKE %s"
        cursor = db.cursor()

        # Thực thi câu lệnh SQL
        cursor.execute(sql)

        # Lấy kết quả
        row = cursor.fetchone()

        # Kiểm tra dữ liệu tồn tại
        if row is not None:
            return True
        else:
            return False
    def thediembanganh(self):
        root = tk.Tk()
        app = ImageCropper(root)
        root.mainloop()
        result = Recognize_Digit(app.crop_list)
        ids, marks = get_recognized_id(result), get_recognized_mark(result)
        sinhviendiem = list(zip(ids, marks))
        result_sub_id = Recognize_Digit(app.sub_id_img)
        idmonhoc = get_recognized_sub_id(result_sub_id)[0]

        result_semester_id = Recognize_Digit(app.semester_id_img)
        mahocki = get_recognized_semester_id(result_semester_id)

        self.tableWidget_6.clearContents()
        self.tableWidget_6.setRowCount(0)

        for row_number, (id_sinhvien, diem) in enumerate(sinhviendiem):
            self.tableWidget_6.insertRow(row_number)
            self.tableWidget_6.setItem(row_number, 0,
                                       QtWidgets.QTableWidgetItem(str(id_sinhvien)))  # Cột 1: ID sinh viên
            self.tableWidget_6.setItem(row_number, 1, QtWidgets.QTableWidgetItem(idmonhoc))  # Cột 2: ID môn học
            self.tableWidget_6.setItem(row_number, 2, QtWidgets.QTableWidgetItem(mahocki))  # Cột 3: Học kì
            self.tableWidget_6.setItem(row_number, 3, QtWidgets.QTableWidgetItem(str(diem)))  # Cột 4: Điểm
        self.tabWidget.setCurrentWidget(self.tab_2)
        self.tabWidget.setTabEnabled(4, True)


    def load_user(self):
        try:
            magv = self.magvtext.text()
            ten = self.tengvtext.text()
            email = self.emailtext.text()
            sdt = self.sdttext.text()
            gtinh = self.gioitinhcbbox.currentIndex()
            khoa = self.khoacbbox.currentText()

            # Lấy MAKHOA từ khoa dựa trên TENKHOA
            query = "SELECT MAKHOA FROM KHOA WHERE TENKHOA LIKE %s"
            cursor = db.cursor()
            cursor.execute(query, (khoa,))
            result = cursor.fetchone()

            if result:
                idkhoa = result[0]
                # Thực hiện cập nhật dữ liệu trong bảng user
                sql = "UPDATE user SET tengiangvien = %s, email = %s, gioitinh = %s, SoDienThoai = %s, makhoa = %s WHERE magv = %s"
                cursor.execute(sql, (ten, email, gtinh, sdt, idkhoa, magv))
                db.commit()
                QMessageBox.information(None, "Thông báo", "Cập nhật thành công")
            else:
                QMessageBox.warning(None, "Cảnh báo", "Không tìm thấy khoa tương ứng")
        except Exception as e:
            print("Lỗi:", e)
            QMessageBox.critical(None, "Lỗi", "Có lỗi xảy ra: " + str(e))

    def doimk(self):
        magv = self.magvtext.text()
        mk_hientai = self.mkcutext.text()
        new_mk = self.mkmoitext.text()
        confirm_mk = self.xacnhanmktext.text()
        if new_mk != confirm_mk:
            QMessageBox.information(None, "Thông báo", "Mật khẩu mới và xác nhận mật khẩu không khớp!")

        cursor = db.cursor()
        sql = "SELECT * FROM user WHERE magv = %s AND matkhau = %s"
        values = (magv, mk_hientai)
        cursor.execute(sql, values)
        result = cursor.fetchone()

        if not result:
            QMessageBox.information(None, "Thông báo", "Mã giảng viên hoặc mật khẩu hiện tại không chính xác!")

        # Update the password with the new password
        sql = "UPDATE user SET matkhau = %s WHERE magv = %s"
        values = (new_mk, magv)
        cursor.execute(sql, values)
        db.commit()
        QMessageBox.information(None, "Thông báo", "Đổi mật khẩu thành công!")

