    def themdiem(self):
        cursor = db.cursor()
        mssv = self.lineEdit_35.text()
        if mssv is None or mssv.strip()=="":
            QMessageBox.warning(None, "Validate", "Điền Mã sinh viên không tồn tại")
        else:
            query = " select * from sinhvien where MASV = {}".format(mssv)
            cursor.execute(query)
            result = cursor.fetchall()
            if len(result)==0 or mssv.strip() =="":
                QMessageBox.warning(None, "Validate", "Mã sinh viên không tồn tại")
            else:

                indexmhoc = self.comboBox_9.currentIndex()
                indexhocki = self.comboBox_8.currentIndex()
                if indexmhoc == 0 or indexhocki == 0:
                    QMessageBox.warning(None, "Validate", "Vui lòng không để trống học kì hoặc tên môn học ")
                else:
                    textmhoc = self.comboBox_9.currentText()
                    texthocki = self.comboBox_8.currentText()
                    query = "select * from mhoc where tenmhoc = '{}'".format(textmhoc)
                    cursor.execute(query)
                    results = cursor.fetchall()
                    if results:  # Kiểm tra xem có kết quả trả về hay không trước khi truy xuất phần tử đầu tiên
                        result = results[0]
                        idmonhoc = result[0]
                    else:
                        print("Không tìm thấy kết quả phù hợp.")
                    query = "select * from diem where IDMAMONHOC ={} AND IDSINHVIEN ={} AND HOCKI ={}".format(idmonhoc,mssv,texthocki)
                    cursor.execute(query)
                    result = cursor.fetchall()
                    if len(result) != 0:
                        QMessageBox.warning(None, "Validate", "Tồn tại điểm của sinh viên với môn và học kì đã điền ")
                    else:
                        diem = self.lineEdit_34.text()
                        if diem is None or diem.strip()=="":
                            QMessageBox.warning(None, "Validate","Sai định dạng điểm")
                        else:
                            try:
                                # Chuyển đổi chuỗi thành số thực
                                diem_float = float(diem)

                                # Nếu không có lỗi, tiếp tục với việc thực hiện lệnh SQL
                                query = "INSERT INTO diem(IDMAMONHOC, IDSINHVIEN, HOCKI, DIEM) VALUES (%s, %s, %s, %s)"
                                cursor.execute(query, (idmonhoc, mssv, texthocki, diem_float))
                                db.commit()
                                self.tabWidget.setCurrentWidget(self.diemsv)
                                self.loaddatatable4()
                                self.loaddatatable5()
                            except ValueError:
                                # Nếu có lỗi khi chuyển đổi sang số thực, hiển thị cảnh báo
                                QMessageBox.warning(None, "Validate", "Sai định dạng điểm")

